import React from 'react';
import { useSelector } from 'react-redux';

import Search from '../../function/search';
import Post from '../../function/post';

import './index.css';

function Body() {
	const ui = useSelector(state => state.ui);

	return (
		<div className='body'>
			{ ui.search ? <Search /> : 
			<div className='inner-container'>
				<Post />
				<Post />
				<Post />
			</div>
			}
		</div>
	);
}

export default Body;
